import  React  from "react";
import  ReactDOM  from "react-dom";

const App = () => {
    const text = "hii"
    return (
        <div>
            <h1 className="label" >{text}</h1>
        </div>
    );
}

ReactDOM.render(
    <App />,
    document.querySelector('#root')
)
